import React from 'react';
import Grid from '@mui/material/Grid';

import classes from './Services.module.css';
import Wrapper from '../UI/Wrapper';
import services from './servicesInfo';

import AOS from 'aos';
import 'aos/dist/aos.css'; 


const servicesList = services.map((service) => {
  const { id, title, desc, icon} = service;
  return (
      <Grid 
        item 
        xs={12} 
        md={6} 
        lg={4} 
        key={id}
        sx={{marginBottom: "4rem"}}
      >
        <div>{icon}</div>
        <h3>{title}</h3>
        <p>{desc}</p>
      </Grid>
  )
})

const Services = () => {
  return (
    <div data-aos="fade-in"> 
    <Wrapper className={classes.services}>
      <h2 className={classes["services__title"]}>We offer a complete <br/> range of services</h2>
      <Grid 
        container 
        columnSpacing={{ xs: 1, sm: 4, md: 12 }}
        sx={{
          textAlign: "center", 
          paddingTop: "5%",
          paddingBottom: "5%"
          }}>
        {servicesList}
      </Grid>
    </Wrapper>
    </div>
  )
};

AOS.init();

export default Services;
